// src/App.js
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Routes } from "react-router";
import React from 'react';
import SimpleQuestion from "./SimpleQuestion";
import CompatibilityTab from "./CompatibilityTab";
import Logo from './logo.svg';
import "./App.css";

function App() {
  return (

      <div className="App">
        <header className="App-header">
          <img src={Logo} className="App-logo" alt="logo/"/>
          <h1>Voiance</h1>
          <Router>
          <nav className="Navigation">
            <ul className="ListNav">
              <li>
                <Link className="linkNav" activeStyle={{ color: 'red' }} to="/">Accueil</Link>
              </li>
              <li>
                <Link className="linkNav" activeStyle={{ color: 'red' }} to="/CompatibilityTab">Compatibilit√©</Link>
              </li>
              <li>
                <Link className="linkNav" activeStyle={{ color: 'red' }} to="/SimpleQuestion">Question simple</Link>
              </li>
            </ul>
          </nav>
          <Routes>
            <Route path="/CompatibilityTab" element={<CompatibilityTab />} />
            <Route path="/SimpleQuestion" element={<SimpleQuestion />} />
          </Routes>
          </Router>
        </header>
      </div>

  );
}

export default App;
